import React, {Component} from "react";
import AreaRechartComponent from "./AreaRechartComponent";
import axios from "axios"

const baseURL = ""

class Measurements extends Component {

    state={
        dataCO2: [
            {
                "name": "18:10",
                "CO2": 3432,
            },
            {
                "name": "18:20",
                "CO2": 2342,
            },
            {
                "name": "18:30",
                "CO2": 4565,
            },
            {
                "name": "18:40",
                "CO2": 6654,
            },
            {
                "name": "18:50",
                "CO2": 8765,
            }
        ],
        dataTemp: [
            {
                "name": "18:10",
                "Temperature": 23.5,
            },
            {
                "name": "18:20",
                "Temperature": 23.8,
            },
            {
                "name": "18:30",
                "Temperature": 23.7,
            },
            {
                "name": "18:40",
                "Temperature": 23.6,
            },
            {
                "name": "18:50",
                "Temperature": 23.7,
            }
        ],
    }

    componentDidMount() {
        axios.get(baseURL).then(res =>{
            let data = res.data
            console.log("CO2 data:",data)
            this.setState({dataCO2: data})
        })

        axios.get(baseURL).then(res =>{
            let data = res.data
            console.log("Temperature data:",data)
            this.setState({dataTemp: data})
        })
    }



    render() {
        return(
            <div>
                <h1>MEASUREMENTS</h1>
                <h2>CO2</h2>
                <AreaRechartComponent type={"CO2"} data={this.state.dataCO2}/>
                <h2>Temperature</h2>
                <AreaRechartComponent type={"Temperature"} data={this.state.dataTemp}/>
            </div>
        )
    }
}

export default Measurements;
